import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';
import Home from './pages/Home';
import Header from './components/Header';

function App() {
  return (
    <Router>
      <Route component={Header} />
      <Routes>
        <Route exact path='/' element={ <Home /> } />
      </Routes>
    </Router>
  );
}

export default App;
